import React from 'react';
import "./Footer.css"
import logo from '../../cropped-F-logo.png'

const Footer = () => {
 
    return (
        <div className="footer">
            <h1 className="mt-5 text-center mb-4 text-white"><span className="text-red"><img className="logo" src={logo} alt=""></img>Fitness</span> 101</h1>
            <h5 className="text-center text-white">All rights reserved.</h5>
        </div>
    );
};

export default Footer;
